import React, { useEffect, useState, useRef }  from 'react';
import { useSelector } from "react-redux";
import { usePagination } from '@table-library/react-table-library/pagination';
import { CompactTable } from '@table-library/react-table-library/compact';
import {
      Table,
      Header,
      HeaderRow,
      Body,
      Row,
      HeaderCell,
      Cell,
    } from "@table-library/react-table-library/table";
import { useTheme } from '@table-library/react-table-library/theme';
import { DEFAULT_OPTIONS, getTheme } from '@table-library/react-table-library/material-ui';
import { useSort,HeaderCellSort,
      SortIconPositions,
      SortToggleType, } from '@table-library/react-table-library/sort';


function TableView(){
      // Design
      const materialTheme = getTheme({
            ...DEFAULT_OPTIONS,
            striped: true,
            highlightOnHover: true,
      });
      const customTheme = {
            Table: `
                  --data-table-library_grid-template-columns:  70px repeat(5, minmax(0, 1fr));

                  margin: 16px 0px;
            `,
      };
      const theme = useTheme([materialTheme, customTheme]);


      let employees = useSelector((state) => state.employees.employees);
      //employees = [...new Set(employees.map((employee, index) => { return { ...employee, id: index, startDate: formatDate(employee.startdate), dateOfBirth: formatDate(employee.birthdate) } }))];

      // const nodes = localStorage.getItem("employees") !== null
      // ? JSON.parse(localStorage.getItem("employees"))
      // : [];
      const nodes = employees !== null ? employees : []

      let data = { nodes };

      const [search, setSearch] = React.useState('');
      const [newData, setNewData] = React.useState(data)
      console.log(newData)

      // Table functionality
       const COLUMNS = [
            { label: 'First Name', renderCell: (item) => item.employee.firstName, sort: { sortKey: 'FIRSTNAME' } },
            { label: 'Last Name', renderCell: (item) => item.employee.lastName, sort: { sortKey: 'LASTNAME' } },
            { label: 'Start Date', renderCell: (item) => item.employee.startDate, sort: { sortKey: 'STARTDATE' } },
            { label: 'Department', renderCell: (item) => item.employee.department.label, sort: { sortKey: 'DEPARTMENT' } },
            { label: 'Date of Birth', renderCell: (item) => item.employee.birthDate, sort: { sortKey: 'BIRTHDATE' } },
            { label: 'Street', renderCell: (item) => item.employee.street, sort: { sortKey: 'STREET' } },
            { label: 'City', renderCell: (item) => item.employee.city, sort: { sortKey: 'CITY' } },
            { label: 'State', renderCell: (item) => item.employee.state, sort: { sortKey: 'STATE' } },
            { label: 'Zip Code', renderCell: (item) => item.employee.zipCode, sort: { sortKey: 'ZIPCODE' } },
      ];



            // sorting //
      function onSortChange(action, state) {
            console.log(action, state);
      }
      const sort = useSort(data,{
            onChange: onSortChange,
      },{
            sortFns: {
                  FIRSTNAME: (array) => array.sort((a, b) => a.firstName.localeCompare(b.firstName)),
                  STARTDATE: (array) => array.sort((a, b) => a.startDate - b.startDate),
                  LASTNAME: (array) => array.sort((a, b) => a.lastName.localeCompare(b.lastName)),
                  DEPARTMENT: (array) => array.sort((a, b) => a.department.localeCompare(b.department)),
                  BIRTHTDATE: (array) => array.sort((a, b) => a.birthDate - b.birthdate),
                  STREET: (array) => array.sort((a, b) => a.street.localeCompare(b.street)),
                  CITY: (array) => array.sort((a, b) => a.city.localeCompare(b.city)),
                  STATE: (array) => array.sort((a, b) => a.state.localeCompare(b.state)),
                  ZIPCODE: (array) => array.sort((a, b) => a.zipCode.localeCompare(b.zipCode)),
            },
      },);
            // search //
      function filtered(search){
            const myNewData = data.nodes
            data.nodes.map(node => {
                        let strings = Object.values(node)
                        return {
                              node: node,
                              nodeStrings: strings.join(" ")
                        }
                  })
                  .filter(nodeComplex => {
                        return nodeComplex
                        .nodeStrings
                        .toLowerCase()
                        .includes(search.toLowerCase())
                  })
                  .map(nodeComplex => nodeComplex.node)

            setNewData({nodes:[myNewData]})


      }
      const handleSearch = (event) => {
            setSearch(event.target.value);
            if (event.target.value.length > 0 ) {
                  filtered(event.target.value)

            } else {
                  setNewData(data)
            }
      };

            // paging
      const showEntries = [10, 25, 50, 100]
      const [selectValue, setSelect] = React.useState(10)
      const [startEntry, setStartEntry] = React.useState(1)
      const [endEntry, setEndEntry] = React.useState(Math.min(10,newData.nodes.length))

      function changeSelect(event){
            setSelect(event.target.value)
      }

      const pagination = usePagination(
            newData,
            {
                  state: {
                        page: 0,
                        size: selectValue,
                  },
                  onChange: onPaginationChange,
            }
          );

      function onPaginationChange(action, state) {
            const currentPage = state.page
            const size = state.size
            const start = currentPage*size+1
            const end = Math.min(currentPage*size+size,newData.nodes.length)
            setStartEntry(start)
            setEndEntry(end)
      }


      return (

            <>
            {/* {console.log(employees.length)} */}
            {/*{newData.nodes.map(el => {
                  console.log(el.newEmployee.department)
            })} */}
                  <div className='table-header' style={{ display:"flex", justifyContent:"space-between", width:"100%"}}>
                        <label htmlFor="select">Show
                              <select className='show-entries' onChange={changeSelect}>
                                    {showEntries.map(entry => {
                                          return <option >{entry}</option>
                                    })}
                              </select>entries
                        </label>
                        <label htmlFor="search">Search by Task:&nbsp;
                              <input id="search" type="text" value={search} onChange={handleSearch} />
                        </label>
                  </div>
                  {/* <CompactTable columns={COLUMNS} data={newData} theme={theme} sort={sort} pagination={pagination} style={{color:"black"}}/> */}
                  <Table data={newData} sort={sort} theme={theme} pagination={pagination} style={{color:"black"}}>
                        {console.log(newData)}
                  {(tableList) => (
                        <>
                        <Header>
                              <HeaderRow>
                              <HeaderCellSort sortKey="FIRSTNAME">First name</HeaderCellSort>
                              <HeaderCellSort sortKey="LASTNAME">Last name</HeaderCellSort>
                              <HeaderCellSort sortKey="STARTDATE">Start date</HeaderCellSort>
                              <HeaderCellSort sortKey="DEPARTMENT">Department</HeaderCellSort>
                              <HeaderCellSort sortKey="BIRTHDATE">Date of birth</HeaderCellSort>
                              <HeaderCellSort sortKey="STREET">Street</HeaderCellSort>
                              <HeaderCellSort sortKey="CITY">City</HeaderCellSort>
                              <HeaderCellSort sortKey="STATE">State</HeaderCellSort>
                              <HeaderCellSort sortKey="ZIPCODE">Zipcode</HeaderCellSort>
                              </HeaderRow>
                        </Header>
                        <Body>
                              {tableList.map((item) => (
                              <Row item={item.employee}>
                              <Cell>{item.employee.firstName}</Cell>
                              {/* <Cell>
                                    {item.deadline.toLocaleDateString("en-US", {
                                    year: "numeric",
                                    month: "2-digit",
                                    day: "2-digit",
                                    })}
                              </Cell> */}
                              <Cell>{item.lastName}</Cell>
                              <Cell>{item.startDate}</Cell>
                              <Cell>{item.department}</Cell>
                              <Cell>{item.birthDate}</Cell>
                              <Cell>{item.street}</Cell>
                              <Cell>{item.city}</Cell>
                              <Cell>{item.state}</Cell>
                              <Cell>{item.zipCode}</Cell>
                              </Row>
                              ))}
                        </Body>
                        </>
                        )}
                  </Table>

                  <div className='table-footer' style={{display:"flex", justifyContent:"space-between", width:"100%"}}>
                        <span>Showing {startEntry} to {endEntry} of {newData.nodes.length} entries</span>
                        <div style={{ display: 'flex', justifyContent: 'space-between' }}>
                              <span>Total Pages: {pagination.state.getTotalPages(newData.nodes)}</span>
                              <span>Page:{' '} {pagination.state.getPages(newData.nodes).map((_, index) => (
                                    <button key={index} type="button" style={{ fontWeight: pagination.state.page === index ? 'bold' : 'normal',}} onClick={() => pagination.fns.onSetPage(index)}>
                                          {index + 1}
                                    </button>
                              ))}
                              </span>
                        </div>
                  </div>
            </>
      );
}

export default TableView;
